import React from 'react';

import { AiTwotoneHome } from "react-icons/all";

import { Wrapper, Header, Content, Footer, Button, Container  } from './styles';

import logo from '../../assets/images/logo.png';

function Main() {
  return (
      <Wrapper>
        <Header>
        <img src={logo}/>
         <h1>Hello, World!</h1>
         <div>asasasas</div>
        </Header>
        <Content>
           <Button>
             <AiTwotoneHome size="20" color="#fff"  />

             <div class = "container"/>

             <span>Entrar</span>
           </Button>
           <span>asahsaushasuahsuahsaus</span>
        </Content>
        <Footer>
          asasasaushasuahsaus
        </Footer>
      </Wrapper>  
  )
}

export default Main;
